import axios from 'axios'
import React, { useState } from 'react'

function FetchData1() {
    const [mydata,setMydata]=useState({
        origin:'',
        routes:'' ,
        status:''
    })

    const handleClick=()=>{
        const url='http://maps.googleapis.com/maps/api/directions/json?origin=" . $origin . "&destination=" . $destination . "&sensor=false'
        axios.get(url)
        .then((response)=>{
            console.log(response)
            setMydata(response.data)
        })
        .catch((error)=>{
            console.log(error)
        })
    }

    return (
      <div>
          <button onClick={handleClick} >FetchData</button>
          <p>{mydata.error_message}</p>
          <div>{mydata.routes}</div>
          <div>{mydata.status}</div>
      </div>
    );
  }
  
  export default FetchData1;
